import React from 'react';
import { Link } from 'react-router-dom';

const Header = () => {
  return (
    <header className="bg-gray-600 p-4 text-white flex justify-between">
      <h1 className="text-x3l">Remote Control App by ahmmedessa</h1>
      <nav>
        <Link to="/" className="mr-4">Login</Link>
        <Link to="/dashboard">Dashboard</Link>
        <></>
      </nav>
    </header>
  );
};

export default Header;
